export const icons = {
  get check() {
    return require('./check.png');
  },
  get checkSmall() {
    return require('./check-small.png');
  },
  get minusSmall() {
    return require('./minusSmall.png');
  },
  get plusSmall() {
    return require('./plusSmall.png');
  },
  get search() {
    return require('./search.png');
  },
  get x() {
    return require('./x.png');
  }
};
